import React, {Component} from 'react';

import Home from './Home';
import Projects from './Projects';
import About from './About';

class Body extends Component {
  constructor(props){
    super(props);
    this.state = {
      home: true,
      projects: false,
      about: false
    };
  }

  render() {
    const { home, projects, about } = this.state;
    return (
      <>
      {home &&
        <Home />
      }
      {projects &&
        <Projects />
      }
      {about &&
        <About />
      }
      </>
    );
  }
}
export default Body;
